schema:
{
 "description": "DBParameterGroup is the Schema for the DBParameterGroups API",
 "properties": {
  "spec": {
   "description": "DBParameterGroupSpec defines the desired state of DBParameterGroup.


Contains the details of an Amazon RDS DB parameter group.


This data type is used as a response element in the DescribeDBParameterGroups
action.",
   "properties": {
    "description": {
     "description": "The description for the DB parameter group.",
     "type": "string"
    },
    "family": {
     "description": "The DB parameter group family name. A DB parameter group can be associated
with one and only one DB parameter group family, and can be applied only
to a DB instance running a database engine and engine version compatible
with that DB parameter group family.


To list all of the available parameter group families for a DB engine, use
the following command:


aws rds describe-db-engine-versions --query "DBEngineVersions[].DBParameterGroupFamily"
--engine <engine>


For example, to list all of the available parameter group families for the
MySQL DB engine, use the following command:


aws rds describe-db-engine-versions --query "DBEngineVersions[].DBParameterGroupFamily"
--engine mysql


The output contains duplicates.


The following are the valid DB engine values:


  - aurora (for MySQL 5.6-compatible Aurora)


  - aurora-mysql (for MySQL 5.7-compatible and MySQL 8.0-compatible Aurora)


  - aurora-postgresql


  - mariadb


  - mysql


  - oracle-ee


  - oracle-ee-cdb


  - oracle-se2


  - oracle-se2-cdb


  - postgres


  - sqlserver-ee


  - sqlserver-se


  - sqlserver-ex


  - sqlserver-web",
     "type": "string"
    },
    "name": {
     "description": "The name of the DB parameter group.


Constraints:


  - Must be 1 to 255 letters, numbers, or hyphens.


  - First character must be a letter


  - Can't end with a hyphen or contain two consecutive hyphens


This value is stored as a lowercase string.",
     "type": "string"
    },
    "parameterOverrides": {
     "additionalProperties": {
      "type": "string"
     },
     "type": "object"
    },
    "tags": {
     "description": "Tags to assign to the DB parameter group.",
     "items": {
      "description": "Metadata assigned to an Amazon RDS resource consisting of a key-value pair.


For more information, see Tagging Amazon RDS Resources (https://docs.aws.amazon.com/AmazonRDS/latest/UserGuide/USER_Tagging.html)
in the Amazon RDS User Guide.",
      "properties": {
       "key": {
        "type": "string"
       },
       "value": {
        "type": "string"
       }
      },
      "type": "object"
     },
     "type": "array"
    }
   },
   "required": [
    "description",
    "family",
    "name"
   ],
   "type": "object"
  }
 },
 "title": "DB Parameter Group",
 "type": "object"
}
